value.Description:
Apply caching to your methods without writing any code at all.

Using this tiny little library, caching can be enabled for any method by just decorating the methods with the Cached attribute.

Given this class:

    public class SomeService
    {
        public int CalculateTheMeaningOfLife()
        {
            //Assume some very time consuming calculations here....
            return 42;
        }
    }

We can now add caching to this method by doing this:

    [EnableMethodCaching]
    public class SomeService
    {
        [Cached]
        public int CalculateTheMeaningOfLife()
        {
            //Assume some very time consuming calculations here....
            return 42;
        }
    }

That's it.!!!

The code inside the method will only be executed once.

For any subsequent calls to the same method, the cached value will be returned without actually executing the code.
